import PokemonContext from "../../context/pokemon/PokemonContext";

export const PokemonMain = () => {
  const pokemonContext = useContext(PokemonContext);
  const { getPokemon, pokemon } = pokemonContext;
  console.log(pokemon);

  useEffect(() => {
    getPokemon(11);
    if (pokemon) {
      console.log(pokemon);
    } else {
      console.log("pokemon not loaded");
    }
  }, []);

